var FormFileUpload=function(){return{init:function(){$("#fileupload").fileupload({disableImageResize:false,autoUpload:false,disableImageResize:/Android(?!.*Chrome)|Opera/.test(window.navigator.userAgent),maxFileSize:5000000,acceptFileTypes:/(\.|\/)(gif|jpe?g|png)$/i,});$("#fileupload").fileupload("option","redirect",window.location.href.replace(/\/[^\/]*$/,"/cors/result.html?%s"));if($.support.cors){$.ajax({type:"HEAD"}).fail(function(){$('<div class="alert alert-danger"/>').text("Upload server currently unavailable - "+new Date()).appendTo("#fileupload")})}$("#fileupload").addClass("fileupload-processing");$.ajax({url:$("#fileupload").attr("action"),dataType:"json",context:$("#fileupload")[0]}).always(function(){$(this).removeClass("fileupload-processing")}).done(function(b){$(this).fileupload("option","done").call(this,$.Event("done"),{result:b})})}}}();jQuery(document).ready(function(){FormFileUpload.init()});